import React from "react";

import {
    Card,
    CardBody,
    CardTitle,
    CardSubTitle,
    CardText,
    CardFooter,
    Button,
    Container
}
from "reactstrap";


const Course =() =>
{
    return (
        <div>
          <Card>
            <CardImg top width="100%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />
            <CardBody>
              <CardTitle>Java</CardTitle>
              <CardSubtitle>Spring Boot</CardSubtitle>
              <CardText>Spring Boot is a java based framework </CardText>
              <Button>Button</Button>
            </CardBody>
          </Card>
        </div>
      );
}
export default Course;
